webpackJsonp([35825777789219],{422:function(A,e){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.7%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/debugbanner-7db2d3f07a0901c8ecc5464de94b19be-631b1.jpg"\n        srcset="/static/debugbanner-7db2d3f07a0901c8ecc5464de94b19be-30fbd.jpg 200w,\n/static/debugbanner-7db2d3f07a0901c8ecc5464de94b19be-e87dc.jpg 400w,\n/static/debugbanner-7db2d3f07a0901c8ecc5464de94b19be-631b1.jpg 800w,\n/static/debugbanner-7db2d3f07a0901c8ecc5464de94b19be-ab477.jpg 1000w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Photo by <a href="https://unsplash.com/@joaosilas">Jo√£o Silas</a></h4>\n<p>Towards the end of the last computer science lab that I TA, a student called me over to help him with a bug.\nAfter the first 10 minutes, we still couldn\'t find the issue, every part of my brain was telling me that the code ought to work. It took nearly 20 minutes of helping him dig through his code before we found the issue.</p>\n<p>As usual, the bug was produced by a minute error. He had accidentally switched the order of two of the arguments\nin a function call.</p>\n<p>Immediately after we fixed the bug, and tested the code to make sure it was working, I felt a rush.\nAnyone who has ever felt the joy of fixing a frustrating bug can relate.  We both grinned, he submitted his code, and shook\nmy hand and thanked me for the help.</p>\n<p>Debugging is one of the most common things that I help students with.\nInterestingly, I actually know much less about their code than they do, but I\nam usually able to find the source of their issue not because of what I know,\nbut because of my mindset.</p>\n<p>Oftentimes your mindset can be even more important than what you know.</p>\n<p>Here\'s a link favorite podcast all about debugging.  Even if you don\'t have a technical background,\nI think you\'ll find it highly entertaining.</p>\n<p><a href="https://softwareengineeringdaily.com/2016/11/19/debugging-stories-with-haseeb-qureshi/">Debugging Stories with Haseeb Qureshi</a></p>',frontmatter:{path:"/on-debugging",title:"On Debugging",date:"03-31-2017",tag:"Tech"}}},pathContext:{}}}});
